import React from 'react';
import { VictoryPie, VictoryTheme } from 'victory';
import './Charts.css'

const PieChart = () => {

  return (
    <div className='chart'>
      <VictoryPie
      radius={({ datum }) => datum.y + 75}
      data={[
        { x: "Cats", y: 30 },
        { x: "Dogs", y: 35 },
        { x: "Birds", y: 25 },
        { x: "Rabbits", y: 10 },
      ]}
      theme={VictoryTheme.grayscale}
      />
    </div>
  );
};

export default PieChart;
